import React, { Component } from "react";
import axios from "axios";

class Test extends Component {
  state = {
    url_photo: "",
    url_video: "",
    project_info: "",
    project_title: "",
  };

  getinfo = () => {
    axios.get("http://localhost:5000/info/").then((res) => console.log(res));
  };

  onChangePhoto = (e) => {
    this.setState({
      url_photo: e.target.value,
    });
  };

  onChangeVideo = (e) => {
    this.setState({
      url_video: e.target.value,
    });
  };

  onChangeInfo = (e) => {
    this.setState({
      project_info: e.target.value,
    });
  };

  onChangeTitle = (e) => {
    this.setState({
      project_title: e.target.value,
    });
  };

  onSubmit(e) {}

  render() {
    return (
      <React.Fragment>
        {this.getinfo()}
        <form>
          <div class="form-group">
            <label for="exampleFormControlInput1" style={{ color: "white" }}>
              url_photo
            </label>
            <input
              type="email"
              class="form-control"
              id="url_photo"
              placeholder="name@example.com"
            />
          </div>
          <div class="form-group">
            <label for="exampleFormControlSelect1" style={{ color: "white" }}>
              Example select
            </label>
            <input
              type="email"
              class="form-control"
              id="url_video"
              placeholder="name@example.com"
            />
          </div>

          <div class="form-group">
            <label for="exampleFormControlTextarea1" style={{ color: "white" }}>
              Project info
            </label>
            <textarea
              class="form-control"
              id="project_info"
              rows="3"
            ></textarea>
          </div>
          <div class="form-group">
            <label for="exampleFormControlInput1" style={{ color: "white" }}>
              project_title
            </label>
            <input
              type="email"
              class="form-control"
              id="project_title"
              placeholder="name@example.com"
            />
          </div>
        </form>
      </React.Fragment>
    );
  }
}

export default Test;
